import React from 'react';
import { HashRouter as Router, Routes, Route, Link, useLocation } from 'react-router-dom';
import { Menu, X, Mail, Phone, MapPin, Facebook, Linkedin, Instagram, Clock, ArrowRight, Zap, Wrench, Activity, Shield, Settings, Calendar, Search, Thermometer } from 'lucide-react';

const WA = 'https://wa.me/254725723091';
const TikTok = () => (
  <svg width="20" height="20" viewBox="0 0 256 256" fill="currentColor">
    <path d="M164.4 24a44.9 44.9 0 0 0 25.7 8.2V67a78.9 78.9 0 0 1-26.4-4.8v66.6a65.4 65.4 0 1 1-65.4-65.4h.7v33.1a32.3 32.3 0 1 0 22.3 30.6V24h43.1Z"/>
  </svg>
);

const Nav = () => {
  const {pathname} = useLocation();
  const active = p => pathname.startsWith(p) ? 'border-b-2 border-white' : '';
  return (
    <>
      {[['/about','About Us'],['/products-services','Products'],['/gallery','Gallery'],['/contact','Contact']].map(([to,t]) =>
        <Link key={to} to={to} className={`px-4 py-2 text-white font-bold hover:text-red-400 ${active(to)}`}>{t}</Link>
      )}
    </>
  );
};

const Header = () => {
  const [open, setOpen] = React.useState(false);
  return (
    <header className="bg-black sticky top-0 z-50 text-white shadow-lg">
      <div className="max-w-7xl mx-auto px-4 flex justify-between items-center h-16">
        <Link to="/"><img src="/logo.png" alt="Senrans" className="h-12"/></Link>
        <nav className="hidden md:flex space-x-6"><Nav/></nav>
        <button onClick={()=>setOpen(!open)} className="md:hidden">{open ? <X/> : <Menu/>}</button>
      </div>
      {open && <nav className="md:hidden bg-red-800 p-4 flex flex-col space-y-3"><Nav/></nav>}
    </header>
  );
};

const Slider = () => {
  const [i, setI] = React.useState(0);
  const slides = [
    {img:"/images/slide1.jpg", title:"Custom LV Panels", text:"Built to your exact specs"},
    {img:"/images/slide2.jpg", title:"DSE Auto Transfer Switch", text:"Zero downtime backup"},
    {img:"/images/slide3.jpg", title:"Smart MCCs", text:"Automation & control"}
  ];
  React.useEffect(()=>{const t=setInterval(()=>setI((i+1)%3),5000);return()=>clearInterval(t);},[]);
  return (
    <div className="relative h-96 md:h-screen overflow-hidden">
      {slides.map((s,j)=>(
        <div key={j} className={`absolute inset-0 transition-opacity duration-1000 ${i===j?'opacity-100':'opacity-0'}`}>
          <img src={s.img} alt="" className="w-full h-full object-cover brightness-75"/>
          <div className="absolute inset-0 bg-gradient-to-t from-black via-transparent flex items-center justify-center text-center p-6">
            <div>
              <h1 className="text-4xl md:text-7xl font-black text-white mb-4" style={{fontFamily:'Alegreya,serif'}}>{s.title}</h1>
              <p className="text-xl md:text-3xl text-yellow-300">{s.text}</p>
            </div>
          </div>
        </div>
      ))}
      <div className="absolute bottom-4 left-1/2 -translate-x-1/2 flex gap-2">
        {[0,1,2].map(j=><button key={j} onClick={()=>setI(j)} className={`w-3 h-3 rounded-full ${i===j?'bg-white':'bg-gray-400'}`}/>)}
      </div>
    </div>
  );
};

const Partners = () => {
  const logos = ["siemens","schneider","abb","eaton","danfoss","deepsea","himel"];
  return (
    <section className="bg-white py-12 overflow-hidden">
      <div className="max-w-7xl mx-auto px-4">
        <h2 className="text-3xl font-bold text-center mb-8">PARTNERS WE WORK WITH</h2>
        <div className="flex animate-marquee gap-12">
          {[...logos, ...logos].map((n,i)=><img key={i} src={`/partners/${n}.png`} alt={n} className="h-20 object-contain"/>)}
        </div>
      </div>
      <style jsx>{`@keyframes marquee{0%{transform:translateX(0)}100%{transform:translateX(-50%)}}.animate-marquee{animation:marquee 15s linear infinite; display:flex; width:max-content;}`}</style>
    </section>
  );
};

const Services = () => {
  const list = [
    {Icon:Zap, title:"Electrical Installations", desc:"Wiring & lighting systems"},
    {Icon:Wrench, title:"Panel Assembly", desc:"Custom LV panels built in-house"},
    {Icon:Activity, title:"Energy Monitoring", desc:"Real-time power analytics"},
    {Icon:Shield, title:"Backup Products", desc:"UPS, inverters & generators"},
    {Icon:Settings, title:"DSE Controllers", desc:"Auto-transfer & sync panels"},
    {Icon:Zap, title:"Power Factor Correction", desc:"Up to 30% on KPLC bills"},
    {Icon:Calendar, title:"Annual Maintenance", desc:"24/7 service contracts"},
    {Icon:Thermometer, title:"Thermography", desc:"Prevent downtime with heat scans"}
  ];
  return (
    <section className="py-16">
      <h2 className="text-4xl font-bold text-center mb-12">OUR SERVICES</h2>
      <div className="grid md:grid-cols-2 lg:grid-cols-4 gap-8 max-w-7xl mx-auto px-4">
        {list.map((s,i)=>(
          <div key={i} className="group bg-white rounded-2xl shadow-lg hover:shadow-2xl hover:-translate-y-3 transition-all duration-500 p-8 text-center border">
            <div className="inline-block p-5 bg-red-50 rounded-full mb-5 group-hover:bg-red-600 transition">
              <s.Icon size={40} className="text-red-600 group-hover:text-white"/>
            </div>
            <h3 className="text-xl font-bold mb-3">{s.title}</h3>
            <p className="text-gray-600 text-sm mb-6">{s.desc}</p>
            <a href={WA} className="text-red-600 font-bold flex items-center justify-center gap-2 hover:gap-4 transition">
              Get Quote <ArrowRight size={18}/>
            </a>
            <div className="h-1 bg-gradient-to-r from-red-500 to-red-700 scale-x-0 group-hover:scale-x-100 transition-transform origin-left mt-4"/>
          </div>
        ))}
      </div>
    </section>
  );
};

const Footer = () => (
  <footer className="bg-black text-white py-12">
    <div className="max-w-7xl mx-auto px-4 grid md:grid-cols-4 gap-8 border-b border-gray-800 pb-8">
      <div><Link to="/"><img src="/logo.png" alt="Senrans" className="h-12 mb-4"/></Link></div>
      <div>
        <h3 className="font-bold border-b border-red-600 pb-1 mb-3">Quick Links</h3>
        <ul className="text-sm space-y-1"><li><Link to="/" className="hover:text-red-400">Home</Link></li><li><Link to="/about" className="hover:text-red-400">About</Link></li></ul>
      </div>
      <div>
        <h3 className="font-bold border-b border-red-600 pb-1 mb-3">Contact</h3>
        <p className="text-sm"><Mail size={16} className="inline mr-1"/> sales@senrans.com</p>
        <p className="text-sm"><Phone size={16} className="inline mr-1"/> +254725723091</p>
      </div>
      <div className="flex space-x-4">
        <a href="#" className="hover:text-white"><Facebook size={20}/></a>
        <a href="#" className="hover:text-white"><Instagram size={20}/></a>
        <a href="#" className="hover:text-white"><Linkedin size={20}/></a>
        <a href="https://tiktok.com/@senrans_ltd" target="_blank" className="hover:text-white"><TikTok/></a>
      </div>
    </div>
    <p className="text-center text-xs text-gray-500 pt-6">Â© 2025 Senrans Ventures Ltd</p>
  </footer>
);

const Home = () => (
  <>
    <link href="https://fonts.googleapis.com/css2?family=Alegreya:wght@900&display=swap" rel="stylesheet"/>
    <Slider/>
    <div className="max-w-7xl mx-auto px-4 py-12">
      <Partners/>
      <section className="bg-red-600 text-white p-10 rounded-xl text-center my-12">
        <h3 className="text-2xl font-bold mb-4">Need LV Panels or ATS?</h3>
        <a href={WA} className="bg-white text-red-600 px-8 py-3 rounded-full font-bold inline-flex items-center hover:scale-105 transition">
          Get Quote <Phone size={20} className="ml-2"/>
        </a>
      </section>
      <Services/>
    </div>
  </>
);

const App = () => {
  const {pathname} = useLocation();
  React.useEffect(() => window.scrollTo(0,0), [pathname]);
  return (
    <Router>
      <div className="min-h-screen bg-gray-50">
        <Header/>
        <Routes>
          <Route path="/" element={<Home/>}/>
          <Route path="/about" element={<div className="p-20 text-center text-4xl">About Page</div>}/>
          <Route path="*" element={<div className="p-20 text-center text-4xl">Coming Soon</div>}/>
        </Routes>
        <Footer/>
        <a href={WA} className="fixed bottom-6 right-6 bg-green-500 p-4 rounded-full shadow-xl hover:scale-110 transition z-50">
          <Phone size={28} className="text-white"/>
        </a>
      </div>
    </Router>
  );
};

export default App;
